import {combineReducers } from "redux"

import listReducer from "./listReducer"
import OperationReducer from "./OperationReducer";

import {CONSTANTS} from "../Actions";
let listIDNew=3;
const initialState = {
    title: "This is the title",
    OperationList: [
       {
           listID:0,
           title: 'First List',
           cards:[
               {id:0},
               {id:1}
           ]
       },
       {
        listID:1,
        title: 'Second List',
        cards:[
            {id:0},
            {id:1}
        ]
        }
    ],
    StatusList: [
        {
            listID:0,
            listTitle: 'First List',
            cards:[
                {
                cardTitle: 'First Card',
                cardID:0,
                buttons:[
                        {id:1,titleButton:'1'},
                        {id:2,titleButton:'2'},
                        {id:1,titleButton:'1'},
                        {id:2,titleButton:'2'},
                        {id:1,titleButton:'1'},
                        {id:2,titleButton:'2'},
                    ]
                },
                {
                    cardTitle: 'Second Card',
                    cardID:0,
                    buttons:[
                            {id:1,titleButton:'3'},
                            {id:2,titleButton:'4'},
                        ]
                    }
               ]
         },
         {
         listID:1,
            listTitle: 'Second List',
            cards:[
                {
                cardTitle: 'First Card',
                cardID:0,
                buttons:[
                        {id:1,titleButton:'1'},
                        {id:2,titleButton:'2'},
                    ]
                },
                {
                    cardTitle: 'Second Card',
                    cardID:0,
                    buttons:[
                            {id:1,titleButton:'3'},
                            {id:2,titleButton:'4'},
                        ]
                    }
               ]
         }
     ]

     
}


export default combineReducers ({
    lists : listReducer,
    operationReducer: OperationReducer

});
